  font-style: normal;
}
.icon-file-text:before,
.icon-file-directory:before,
.icon-file-media:before,
.icon-book:before {
  text-align: center;
}
.icon-file-directory[data-name=".git"]:before {
  font-family: "devicons";
  font-size: large;
  text-align: center;
  top: 3px;
